import React from 'react';

const Header = () => {
  return (
    <div className="header-container">
      <button type="button" className="button-52">
        Contact Us
      </button>
      <img alt="" />
      <div >
        <button type="button" className="button-52">
          Login
        </button>
        <button type="button" className="button-52">
          Sign Up
        </button>
      </div>
    </div>
  );
};

export default Header;
